const aTypeUpdateHeaderHeight = 'UpdateHeaderHeight';

function actionUpdateHeaderHeight(val){
    return {
        type: aTypeUpdateHeaderHeight,
        val
    }
}

function updateHeaderHeight(val){
    return actionUpdateHeaderHeight(val);
}

export {aTypeUpdateHeaderHeight, updateHeaderHeight}
